import React from 'react';
import Tour from './tour/Tour';


function Tours({ data }) {
  return (
    <div>
    {data.map((tour) => (
      <Link key={tour.id} to={`/city/${tour.id}`}>
        <div>
          <h2>{tour.name}</h2>
          <img src={tour.image} alt={tour.name} />
        </div>
      </Link>
    ))}
  </div>
);
}

export default Tours;
